def format_currency(amount: int, currency: str = 'USD') -> str:
    currency_symbols = {
        'USD': '$',
        'EUR': '€',
        'GBP': '£',
        'JPY': '¥',
        'CAD': 'C$',
        'AUD': 'A$',
        'CHF': 'CHF ',
        'CNY': '¥',
        'SEK': 'kr',
        'NZD': 'NZ$'
    }
    symbol = currency_symbols.get(currency, '$')
    if currency in ['USD', 'EUR', 'GBP', 'CAD', 'AUD', 'CHF', 'CNY', 'SEK', 'NZD']:
        return f"{symbol}{amount:,.2f}"
    elif currency == 'JPY':
        return f"{symbol}{amount:,.0f}"
    else:
        return f"{symbol}{amount:,.2f}"
